import React, { Component } from 'react';
import { Layout } from 'antd';
import '.././css/signalvisualizationpage.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import { Navbar, Nav } from 'react-bootstrap';
import { Image} from 'react-bootstrap';
import { ListGroup} from 'react-bootstrap';
import DataService from '.././services/DataService.js';
import axios from 'axios';

const { Content, Sider } = Layout;

class datapage extends Component{
  constructor(props) {
    super(props);
    this.state = {
      image: []
    };
  }

  componentDidMount(){
    // DataService.getData(this.props.location.state.username).then(response => {
    //       if(response.data) {
    //         this.setState({image: response.data});
    //       }
    // });
    axios.get(
      'http://localhost:8080/data',
      {
        headers: {
          'Authorization': 'Bearer ' + localStorage.getItem("authorization"),
          "Content-Type": "application/json",
          "Access-Control-Allow-Origin": "*",
          "Access-Control-Allow-Methods": "DELETE, POST, GET, OPTIONS",
          "Access-Control-Allow-Headers": "Content-Type, Access-Control-Allow-Headers, Authorization, X-Requested-With",
          'Access-Control-Allow-Credentials' : 'true'
        },
        responseType: 'blob'
      }
    )
    .then(response => {
      this.setState({image: response.data})
    })
  }

  handleLogout() {
    localStorage.clear();
    window.location.href = "/";
  }

  render(){
    return (
      <div>
        <Layout>
          <Navbar fixed="top" expand="lg" bg="dark" variant="dark">
            <Navbar.Brand className="navbar-brand">Quasar</Navbar.Brand>
            <Navbar.Toggle />
            <Navbar.Collapse className="justify-content-end">
              <Nav className="mr-auto">
                    <Nav.Link href="/profile">profile</Nav.Link>
                    <Nav.Link href="/upload">upload file</Nav.Link>
              </Nav>
              <Nav>
                <Nav.Link onClick={this.handleLogout}>Log out</Nav.Link>
              </Nav>
            </Navbar.Collapse>
          </Navbar>
          <Layout>
            <Sider width={200} style={{ padding: '8% 1%', background: 'white' }}>
              <Image className="profile-img" src="https://images.hdrsoft.com/images/lighthouse/thumbs/hdr-vibrant.jpg" roundedCircle />
              <ListGroup variant="flush">
                <ListGroup.Item></ListGroup.Item>
                <ListGroup.Item>name: {this.props.location.state.username}</ListGroup.Item>
                <ListGroup.Item>location: {this.props.location.state.location}</ListGroup.Item>
                <ListGroup.Item></ListGroup.Item>
              </ListGroup>
            </Sider>
            <Layout style={{ padding: '8% 0%' }}>
              <Content
                className="site-layout-background"
                style={{
                  padding: '0% 5%',
                  margin: 0,
                  minHeight: 580,
                }}
              >
                <Nav variant="tabs" defaultActiveKey="/data">
                  <Nav.Item>
                    <Nav.Link href="/data">data</Nav.Link>
                  </Nav.Item>
                  <Nav.Item>
                    <Nav.Link href="/rawdata">Raw data</Nav.Link>
                  </Nav.Item>
                  <Nav.Item>
                    <Nav.Link href="/decodeddata">Decoded data</Nav.Link>
                  </Nav.Item>
                </Nav>
                <Image className="data-img" src={this.state.image}/>
              </Content>
            </Layout>
          </Layout>
        </Layout>
      </div>
    );
  }
}

export default datapage;
